oxy_webhelp_navlinks = {"legal_hold_snapshot_rtn-d22872e27986":{"topics":[{"title":"Placing SAP HANA snapshots on legal hold","shortdesc":"<p class=\"shortdesc\">To prevent the Rubrik cluster from expiring and removing the snapshots of SAP HANA         databases, place a legal hold on the snapshots listed on the SAP HANA inventory         page.<\/p>","href":"saas\/placing_legal_hold_sap_hana.html","attributes":{"data-id":"placing_legal_hold_sap_hana"},"menu":{"hasChildren":false},"tocID":"placing_legal_hold_sap_hana-d22872e27997","topics":[]},{"title":"Removing legal hold from SAP HANA snapshots","shortdesc":"<p class=\"shortdesc\">To remove a legal hold from the snapshots of SAP HANA databases for returning to a         regular retention management, log in using an <span class=\"ph\">RSC<\/span> administrator account and         open the SAP HANA inventory page.<\/p>","href":"saas\/removing_legal_hold_sap_hana.html","attributes":{"data-id":"removing_legal_hold_sap_hana"},"menu":{"hasChildren":false},"tocID":"removing_legal_hold_sap_hana-d22872e28008","topics":[]}]}};